import '../App.css';
import {BrowserRouter, Routes, Route} from 'react-router-dom';
import Base from '../components/Base';
// import Button from './components/Button';

const App = () => {
    <BrowserRouter>
      <div>
        <Routes>
          <Route path="/" exact={true} element={<Base />} />
        </Routes>
      </div>
    </BrowserRouter>
}

export default App;
